$(function(){$.fn.willtabs=function(e){var t={tabBG:"#eee",activeTabBG:"#fff",borderStyle:"1px solid #999",tabTopMargin:"20px",contentPadding:"10px 0"};$.extend(t,e);$(this).each(function(){if($(this).hasClass(".willtab-container")){var e=$(this)}else{var e=$(this).find(".willtab-container")}e.each(function(){var e=$(this).children(".willtab-tabs");var n=$(this).children(".willtab-content");e.css({margin:t.tabTopMargin+" 0 0 0",display:"block"}).bind("checkstyle",function(){var e=$(this).find("li").css({"float":"left","list-style":"none"});e.find("a").css({border:t.borderStyle,background:t.tabBG,padding:"5px 15px",color:"inherit"}).each(function(e){if(e>0){$(this).css("margin-left","-1px")}});e.filter(".active").find("a").css({background:t.activeTabBG,"padding-top":"7px","margin-top":"-2px"})});n.css({clear:"both",padding:t.contentPadding});e.find("a").bind("click",function(){n.children(".tab-"+$(this).attr("data-tab")).show().siblings().hide();e.children(".active").removeClass("active");$(this).parent().addClass("active");e.trigger("checkstyle");return false});e.find("a:first").trigger("click")})})}})